            <div class="flex flex-col items-center justify-center text-center ">
                <div class="text-3xl md:text-6xl font-extrabold text-orange-500 mb-10">الفصل الممتع</div>
                <div class="font-bold">
                    حول فصلك الى تجربة تعليمية ممتعة !
                    عن طريق مجموعة أدوات ميسرة تساعدك على ادارة فصلك
                </div>
                <a href="/teacher/register" class="bg-orange-500 text-white w-32 h-12 mt-4 rounded-2xl shadow-2xl text-center flex items-center justify-center font-bold">ابدأ الآن</a>
            </div>

        </div>
    </div>



    <!-- Features -->
    <div class="flex justify-center items-center bg-orange-100 w-screen h-screen">

        <div class="grid grid-cols-1 md:grid-cols-3 gap-4 p-8">
            <!-- Avatar Feature -->
            <div class="flex flex-col items-center bg-orange-50 rounded-2xl p-8  ">

                <img class="w-12 mb-4 rounded-full" src="https://api.dicebear.com/7.x/bottts-neutral/svg?seed=Emmie Jakubowski&eyes=sensor&mouth=grill03&backgroundType=gradientLinear" />
                <div class="font-bold text-2xl text-center ">شخصية متفردة </div>
                <div class="text-center text-xl ">كل طالب لديه شخصية بشكل مميز يمكنه تحسينها بجمع النقاط </div>

            </div>

            <!-- Week king Feature -->
            <div class="flex flex-col items-center bg-orange-50 rounded-2xl p-8  ">

                <svg class="w-12 mb-4"  xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="rgba(240,187,64,1)"><path d="M2.00488 19H22.0049V21H2.00488V19ZM2.00488 5L7.00488 8.5L12.0049 2L17.0049 8.5L22.0049 5V17H2.00488V5ZM4.00488 8.84131V15H20.0049V8.84131L16.5854 11.2349L12.0049 5.28024L7.42435 11.2349L4.00488 8.84131Z"></path></svg>

                <div class="font-bold text-2xl text-center ">
                    ملك الأسبوع
                </div>
                <div class="text-center text-xl "> الطالب الأكثر تميزا خلال الأسبوع يحصل على وسام الملك وتكون بطاقته مميزة لمدة أسبوع كامل </div>

            </div>

            <!-- Points Feature -->
            <div class="flex flex-col items-center bg-orange-50 rounded-2xl p-8  ">

                <svg class="w-12 mb-4" xmlns="http://www.w3.org/2000/svg" fill="red" class="bi bi-heart-fill" viewBox="0 0 16 16">
                    <path fill-rule="evenodd" d="M8 1.314C12.438-3.248 23.534 4.735 8 15-7.534 4.736 3.562-3.248 8 1.314"/>
                </svg>

                <div class="font-bold text-2xl text-center ">
                     التعزيز
                </div>
                <div class="text-center text-xl "> يمكنك اضافة أو حسم النقاط من الطالب مباشرة بناء على سلوكه أو مشاركته </div>

            </div>

            <!-- Levels Feature -->
            <div class="flex flex-col items-center bg-orange-50 rounded-2xl p-8  ">

                <x-mdi-star-four-points-circle class="w-12 mb-4 text-amber-500" />


                <div class="font-bold text-2xl text-center ">
                    المستويات
                </div>
                <div class="text-center text-xl "> يتم ترقية مستوى الطالب بعد جمعه عدد معين النقاط وسيحصل على جائزة عند كل مستوى جديد </div>

            </div>

            <!-- class and groups Feature -->
            <div class="flex flex-col items-center bg-orange-50 rounded-2xl p-8  ">

                <x-grommet-group class="w-12 mb-4 text-amber-800 " />

                <div class="font-bold text-2xl text-center ">
                    الفصول والمجموعات
                </div>
                <div class="text-center text-xl "> يمكنك انشاء عدة فصول وكل فصل من الممكن أن يقسم الى مجموعات كل مجموعة وفصل يمنح نقاط ومستويات بناء على تميز الطلاب </div>

            </div>

            <!-- More Tools -->
            <div class="flex flex-col items-center bg-orange-50 rounded-2xl p-8  ">

                @svg('fontaudio-random-1dice', ['class' => 'w-12 mb-4 text-orange-500'])
                <div class="font-bold text-2xl text-center ">أدوات مساعدة </div>
                <div class="text-center ">يتم بشكل دوري اضافة ادوات جديدة على المنصة تساعد على إدارة الصف مثل اختيار طالب عشوائيا, تحدي القمة والمزيد </div>

            </div>
        </div>

    </div>


</div>

</body>
</html>
